conf = ConfigParser()
conf.read(FILEDIR + "/config.ini", encoding="utf-8")
config = {}
for i in conf.sections():
    for j in conf.options(i):
        try:
            config[j] = conf.getboolean(i, j)
        except:
            config[j] = conf.get(i, j)


class MicaWindow(Window):

    def __init__(self):
        super().__init__()
        self.setTitleBar(MSFluentTitleBar(self))
        if isWin11():
            self.windowEffect.setMicaEffect(self.winId(), isDarkTheme())


def changeVal(sec, opt, val):
    conf.set(sec, opt, val)
    config[opt] = val
    with open(FILEDIR + "/config.ini", "w") as f:
        conf.write(f)


class Bypass(QThread):
    messageboxShow = pyqtSignal(str, str, int)
    over = pyqtSignal()

    def run(self):
        result = subprocess.run("netsh interface set interface " + config["adapter"] + " admin=enable",
                                capture_output=True,
                                text=True, shell=True)
        if result.returncode != 0:
            self.messageboxShow.emit("error", "网络连接失败: " + str(result), 7000)
        f = open(user_dir + "/.lunarclient/logs/launcher/main.log", "r").read().replace(
            "Spawning JVM process with following configuration...", "")
        w = open(user_dir + "/.lunarclient/logs/launcher/main.log", "w")
        w.write(f)
        w.close()

        while True:
            fn = open(user_dir + "/.lunarclient/logs/launcher/main.log", "r").read()
            if "Spawning JVM process with following configuration..." in fn:
                self.messageboxShow.emit("warning", "检测到游戏启动。准备绕过……", 5000)
                result = subprocess.run("netsh interface set interface " + config["adapter"] + " admin=disable",
                                        capture_output=True,
                                        text=True, shell=True)
                if result.returncode != 0:
                    self.messageboxShow.emit("error", "网络断开失败: " + str(result), 7000)
                fn = fn.replace("Spawning JVM process with following configuration...", "")
                w = open(user_dir + "/.lunarclient/logs/launcher/main.log", "w")
                w.write(fn)
                w.close()
                time.sleep(10)
                result = subprocess.run("netsh interface set interface " + config["adapter"] + " admin=enable",
                                        capture_output=True,
                                        text=True, shell=True)
                if result.returncode != 0:
                    self.messageboxShow.emit("error", "网络连接失败: " + str(result), 7000)
                if config["auto"]:
                    self.messageboxShow.emit("success", "绕过已完成。程序将在5秒后退出", -1)
                    time.sleep(5)
                    self.over.emit()
                else:
                    self.messageboxShow.emit("success", "绕过已完成。请及时退出程序。", -1)
                break

            time.sleep(0.1)


